import PopupWithForm from './PopupWithForm';

function BinPopup({ isOpen, onClose, onDeleteCard, card}) {

    function handleSubmit(e) {
        e.preventDefault();
        onDeleteCard(card);
      }

    return(
        <PopupWithForm
          name='bin-popup'
          isOpen={isOpen}
          title='Вы уверены?'
          onClose={onClose}
          saveText='Да'
          onSubmit={handleSubmit}
        />

    )
}

export default BinPopup;
